import { Button } from "../components/ui/button";

export default function Home() {
  return (
    <div className="relative min-h-screen flex items-center justify-center bg-gray-900 text-white overflow-hidden">
  <div className="absolute inset-0 bg-[radial-gradient(#6d28d9_1px,transparent_1px)] [background-size:40px_40px] opacity-20"></div>

  <div className="z-10 text-center p-8 bg-white/10 backdrop-blur-md rounded-3xl shadow-2xl max-w-2xl">
    <h1 className="text-4xl font-bold text-purple-300 mb-4">Welcome to Food Finder</h1>
    <p className="text-lg text-gray-200 mb-6">Craving something? We’ll find the best for you in Malaysia!</p>
    <Button>Let’s Go</Button>
  </div>
</div>
  );
}
